(12654, 9344, 1469, 3, 'World Spins Madly On', '', '2006-03-07 00:00:00', 0000, 20, 0, 6, '', 'Woke up and wished that I was dead\nWith an aching in my head \nI lay motionless in bed\nI thought of you and where you''d gone\nand let the world spin madly on\n\nEverything that I said I''d do \nLike make the world brand new\nAnd take the time for you\nI just got lost and slept right through the dawn \nAnd the world spins madly on\n\nI let the day go by \nI always say goodbye\nI watch the stars from my window sill \nThe whole world is moving and I''m standing still\n\nWoke up and wished that I was dead \nWith an aching in my head \nI lay motionless in bed\nThe night is here and the day is gone\nAnd the world spins madly on\n\nI thought of you and where you''d gone \nAnd the world spins madly on.', 165, '', '', '', '', '', '', 0, 1, 0, '2009-01-16 18:15:11', '2015-03-12 13:36:51', '0000-00-00 00:00:00'),
