(12658, 9344, 1469, 7, 'Painting By Chagall', '', '2006-03-07 00:00:00', 0000, 20, 0, 6, '', 'Thunder rumbles in the distance, a quiet intensity\nI am willful, your insistence is tugging at the best of me \nYou''re the moon, I''m the water\nYou''re Mars, calling up Neptune''s daughter \n\nSometimes rain that''s needed falls \nWe float like two lovers in a painting by Chagall\nAll around is sky and blue town \nHolding these flowers for a wedding gown\nWe live so high above the ground, satellites surround us. \n\nI am humbled in this city\nThere seems to be an endless sea of people like us\nWakeful dreamers, I pass them on the sunlit streets \nIn our rooms filled with laughter\nWe make hope from every small disaster\n\nEverybody says "you can''t, you can''t, you can''t, don''t try." \nStill everybody says that if they had the chance they''d fly like we do.', 238, '', '', '', '', '', '', 0, 1, 0, '2009-01-16 18:15:45', '2015-03-12 13:36:52', '0000-00-00 00:00:00'),
